import {useState} from "react";
import {
    Container,
    CssBaseline,
    Box,
    Avatar,
    Typography,
    TextField,
    Button,
    Grid,
} from "@mui/material";

const Login = () => {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

    return (
        <>
            <TextField
                id="email"
                label="Email Address"
                value={email}
                onChange={(e) => {setEmail(e.target.value)}}
            />
            <TextField
                id="password"
                label="Password"
                value={password}
                onChange={(e) => {setPassword(e.target.value)}}
            />
        </>
    )
}

export default Login;
